function using(e,n){if(null==n)for(var t in e)this[t]=e[t];else for(var t in"string"==typeof n&&(n=new RegExp(n)),e)t.match(n)&&(this[t]=e[t])}function copyVec2(e){return new Box2D.b2Vec2(e.get_x(),e.get_y())}function scaleVec2(e,n){e.set_x(n*e.get_x()),e.set_y(n*e.get_y())}function scaledVec2(e,n){return new Box2D.b2Vec2(n*e.get_x(),n*e.get_y())}function createChainShape(e,n){for(var t=new Box2D.b2ChainShape,o=Box2D._malloc(8*e.length),a=0,r=0;r<e.length;r++)Box2D.HEAPF32[o+a>>2]=e[r].get_x(),Box2D.HEAPF32[o+(a+4)>>2]=e[r].get_y(),a+=8;var c=Box2D.wrapPointer(o,Box2D.b2Vec2);return n?t.CreateLoop(c,e.length):t.CreateChain(c,e.length),t}function createPolygonShape(e){for(var n=new Box2D.b2PolygonShape,t=Box2D._malloc(8*e.length),o=0,a=0;a<e.length;a++)Box2D.HEAPF32[t+o>>2]=e[a].get_x(),Box2D.HEAPF32[t+(o+4)>>2]=e[a].get_y(),o+=8;var r=Box2D.wrapPointer(t,Box2D.b2Vec2);return n.Set(r,e.length),n}function createRandomPolygonShape(e){var n=3.5+5*Math.random();n|=0;for(var t=[],o=0;o<n;o++){var a=o/n*360*.017453292519943295;t.push(new b2Vec2(e*Math.sin(a),e*-Math.cos(a)))}return createPolygonShape(t)}